import { IconButton, Stack, useTheme } from "@mui/material";
import HomeRoundedIcon from "@mui/icons-material/HomeRounded";
import TagRoundedIcon from "@mui/icons-material/TagRounded";
import AccountCircleRoundedIcon from "@mui/icons-material/AccountCircleRounded";
import BookmarkBorderRoundedIcon from '@mui/icons-material/BookmarkBorderRounded';
import BookmarkIcon from '@mui/icons-material/Bookmark';
import HomeOutlinedIcon from '@mui/icons-material/HomeOutlined';
import { ReactComponent as Logo } from "../icons/logo.svg";
import { useLocation } from "react-router-dom";

export const NavBar = () => {
  const location = useLocation();
  const theme = useTheme();
  const icons = [
    {
      outlineLogo: (
        <Logo
          fill={theme.palette.primary.main}
          width={"30px"}
          height={"30px"}
        />
      ),
      href: "/home",
    },
    {
      outlineLogo: <HomeOutlinedIcon fontSize="large" />,
      filledLogo: <home fontSize="large" />,
      href: "/home",
    },
    {
      outlineLogo: <TagRoundedIcon fontSize="large" />,
      href: "/explore",
    },
    {
      outlineLogo: <AccountCircleRoundedIcon fontSize="large" />,
      href: "/profile",
    },
    {
      outlineLogo: <BookmarkBorderRoundedIcon fontSize="large" />,
      filledLogo:<BookmarkIcon/>,
      href: "/saved",
    },
  ];

  return (
    <Stack
      minWidth={"75px"}
      spacing={1.5}
      sx={{ backgroundColor: "rgba(255,255,255,0.07)" }}
      height={"100vh"}
      pt={2}
    >
      {icons.map((d, i) => {
        return (
          <IconButton color="primary" key={i} href={d.href}>
            {d.outlineLogo}
          </IconButton>
        );
      })}
    </Stack>
  );
};
